import { Link } from "react-router-dom";

export const Dashboard = () => {
    return (
        <div className="bg-gray-100 min-h-screen flex flex-col justify-center items-center">
            <h1 className="text-gray-800 text-4xl font-serif mb-8">Dashboard</h1>

            <div className="flex flex-wrap justify-center gap-4">
                <div className="w-full md:w-1/2 lg:w-1/3 xl:w-1/4">
                    <Link to="/add-users" className="block w-full bg-blue-600 hover:bg-blue-700 text-white font-bold py-4 px-6 rounded-lg text-center">
                        Add Users
                    </Link>
                </div>
                <div className="w-full md:w-1/2 lg:w-1/3 xl:w-1/4">
                    <Link to="/view-menu" className="block w-full bg-blue-600 hover:bg-blue-700 text-white font-bold py-4 px-6 rounded-lg text-center">
                        View Menu
                    </Link>
                </div>
                <div className="w-full md:w-1/2 lg:w-1/3 xl:w-1/4">
                    <Link to="/manage-caterers" className="block w-full bg-blue-600 hover:bg-blue-700 text-white font-bold py-4 px-6 rounded-lg text-center">
                        Manage Caterers
                    </Link>
                </div>
            </div>
        </div>
    );
};

export default Dashboard;
